import React from 'react';
import HomePage from './components/HomePage';
import PortfolioUploadPageText from './components/PortfolioUploadPage';
import PortfolioUploadPagePDF from './components/PortfolioUploadPagePDF';
import QuestionListPage from './components/QuestionListPage';
import { BrowserRouter as Router, Route } from 'react-router-dom';
const App = () => {

  return (
    <Router>
        <Route exact path="/" component={HomePage} />
        <Route path="/portfolio-upload-text" component={PortfolioUploadPageText} />
        <Route path="/portfolio-upload-pdf" component={PortfolioUploadPagePDF} />
        <Route path="/question-list" component={QuestionListPage} />
    </Router>

  );
};

export default App;
